`,t.jsx(e.p,{children:"This technical, hands-on path is designed for developers and includes both courses and labs. You’ll get experience with crucial topics like image generation, attention mechanisms, encoder-decoder models, and transformers – all foundational for understanding how modern generative models work. Importantly, this path gives you access to Vertex AI Studio and Model Garden through guided labs, so you can try out Google’s PaLM 2 models (for text, chat, code, etc.) and even image generation models in a real environment."}),`
`,t.jsx(e.p,{children:"As you go through the labs, The Google Learning Path validates your ability to develop and implement generative AI models using Google’s technology. In practice, that means you should be comfortable with:"}),`
