`,t.jsxs(e.li,{children:[t.jsx(e.strong,{children:"Core Generative Models:"})," Understand how models like transformers, large language models, and diffusion models work, as well as earlier generative approaches (autoencoders, GANs) for tasks like image generation and translation. You don’t need to derive equations but know the key concepts (e.g. what is attention? how do GANs differ from diffusion models?)."]}),`
`,t.jsxs(e.li,{children:[t.jsx(e.strong,{children:"Implementing AI Solutions:"})," Be familiar with training or fine-tuning models and the basics of frameworks like TensorFlow or PyTorch. The exam may not require writing code from scratch, but you should recognize code snippets and understand the workflow of building and deploying an ML model. Hands-on labs or coursework in your ML classes will help here."]}),`
`,t.jsxs(e.li,{children:[t.jsx(e.strong,{children:"Google Cloud’s AI Offerings:"})," Memorize what generative AI services Google Cloud provides and when to use them. For example, know the purpose of the PaLM API, Vertex AI’s Model Garden (pre-trained models), Generative AI Studio (for prompt prototyping), and tools like Vertex AI Matching Engine (for similarity search in retrieval-augmented generation). Expect questions on which tool is appropriate for a given scenario (e.g. “How to quickly prototype a generative model solution?” -> Vertex AI Studio)."]}),`
`,t.jsxs(e.li,{children:[t.jsx(e.strong,{children:"Optimizing Model Outputs:"})," Learn techniques for improving generative AI results, such as prompt engineering, adjusting temperature/top-k settings for text models, and grounding model outputs with external data. For instance, you encountered prompt design first-hand in the labs. Understand concepts like retrieval-augmented generation (RAG) – e.g., using the Matching Engine to provide documents to the model as context. These strategies help overcome limitations like hallucinations."]}),`
`,t.jsxs(e.li,{children:[t.jsx(e.strong,{children:"Responsible AI and Ethics:"})," Be prepared for questions on detecting and mitigating bias, privacy considerations, and AI safety. Google expects certified developers to know best practices for responsible AI use. This could include knowledge of ",t.jsx(e.em,{children:"Google’s AI Principles"})," and how to apply them (for example, avoiding problematic use cases, or ensuring user data is handled safely when building generative apps)."]}),`
