`,t.jsxs(e.ul,{children:[`
`,t.jsxs(e.li,{children:[t.jsx(e.strong,{children:"Long Document Summarizer (Text-Bison Model):"})," Use the PaLM Text Bison model via Vertex AI to summarize long texts or PDF documents. This project involves breaking a document into chunks and summarizing each part, then refining the results – a strategy to handle model input length limits. Tutorial: ",t.jsx(e.a,{href:"https://codelabs.developers.google.com/vertex-ai-summarization",children:"Google Codelab on Text Summarization with Vertex AI"}),' walks you through multiple methods (like "MapReduce") to generate concise summaries from large documents.']}),`
`,t.jsxs(e.li,{children:[t.jsx(e.strong,{children:"Document Q&A Chatbot with Retrieval:"})," Build a chatbot that can answer questions based on your own documents (like class notes, research papers, or manuals). This project introduces you to retrieval-augmented generation (RAG)—a popular technique that grounds a model's output in real data to improve accuracy and reduce hallucinations. You'll learn how to split documents into chunks, generate embeddings, store them in a vector database, and retrieve relevant text for a user's query before passing it to a language model.",`
`,t.jsxs(e.ul,{children:[`
`,t.jsxs(e.li,{children:[t.jsx(e.strong,{children:"Tutorial:"})," ",t.jsx(e.a,{href:"https://python.langchain.com/docs/tutorials/rag/",children:"LangChain RAG Tutorial"})," – a beginner-friendly walkthrough that runs locally or in Colab, Google's free cloud-based coding environment for Python (no installation required). Once you understand the basics, you can apply the same RAG pipeline using ",t.jsx(e.a,{href:"https://cloud.google.com/vertex-ai/docs/vector-search/overview",children:"Vertex AI Vector Search"})," (formerly Matching Engine) for scalable, production-level retrieval on Google Cloud."]}),`
`]}),`
