`,t.jsx(e.p,{children:"Each of these projects uses Google's generative AI tools and comes with community or official guidance. They are excellent for learning because they expose you to different facets of generative AI (text, images, retrieval, conversation). As always, when following a tutorial, don't just copy code – try to understand it and experiment with tweaks. Often, it can be easy to passively learn these new concepts. Make sure that you're understanding every line of code- whether this is trying to build your own project and not following a tutorial, or having ChatGPT or Copilot explain every line of code."}),`
`,t.jsx(e.p,{children:"If none of these projects interest you, ask a generative model of your choosing to give you a plan and resources to create a topic of your choosing. An example prompt may be:"}),`
`,t.jsxs(e.blockquote,{children:[`
`,t.jsx(e.p,{children:"I think that the big things that I am missing from my resume are R and SQL can you please give me a project that I could do for my resume that would help me hone in on these two skills? In particular, something that will pop for finance/consulting/swe and is different from the LOB simulation that I am also working on. Thank you very much!"}),`
