`,t.jsx(e.p,{children:"To further guide your learning, here are some sample project ideas (with resources) that exclusively use Google’s generative AI offerings like PaLM API, Vertex AI Studio, Model Garden, etc. Each project includes a brief description and a link to a tutorial or code:"}),`
