`,t.jsx(e.p,{children:"Focus on completing one project that you can fully understand and explain during an interview. These are tangible projects that YOU built to highlight your Generative AI development capabilities. It’s better to have a simple working app than an ambitious half-finished one. As you build, make sure to use Google’s tools (Vertex AI Workbench notebooks, Cloud Run for deployment, etc.) so you become comfortable with the ecosystem. For instance, you might deploy your text summarizer as a Flask app on Cloud Run or host your image generator on a simple web server."}),`
`,t.jsxs(e.p,{children:[t.jsx(e.strong,{children:"Portfolio Tip:"})," Put your code on GitHub and include a README describing the project. Even a small project can shine if it’s well-documented. Consider deploying it and adding a screenshot or demo GIF in the README. ChatGPT is great for generating these- consider asking to generate one in the same thread you may be consulting as you build your project so that the model has appropriate context. You can also enable search mode and paste the link to your repository to give the model good context to generate a better README. See Bonus Appendix below for more on GitHub."]}),`
